import {View, Text, Pressable, StyleSheet} from 'react-native';

function PrimaryButton({children}) {

    function pressHandler() {
        console.log('pressed')
    }

    return (
        <Pressable onPress={pressHandler}>
        <View>
            <Text>{children}</Text>
        </View>
        </Pressable>
    )
}

export default PrimaryButton;

const styles = StyleSheet.create({

})
